function exportGardenTab1() {
    showMessage("开始导出数据，请稍后，进度可在控制台查看", "info");
    const TAB = 1;
    const PAGESIZE = 100;
    // 获取页数
    clearMessageList();
    sendMessage_Garden(anchor_uid, TAB, 1, PAGESIZE);
    setTimeout(async () => {
        while (getResponseNum_Garden() < 1) {
            console.log(`正在等待数据返回，请稍后...`);
            await sleep(1000);
        }
        // 获取页数
        let pageNum = 0;
        let msgList = getMessageList();
        for (let i = 0; i < msgList.length; i++) {
            if (msgList[i].ccsid == 42455 && "infos" in msgList[i]) {
                pageNum = msgList[i].infos.count;
                break;
            }
        }

        console.log(`一共有${pageNum}页`);
        // 开始获取全部
        clearMessageList();
        for (let i = 0; i < pageNum; i++) {
            sendMessage_Garden(anchor_uid, TAB, i + 1, PAGESIZE);
            console.log(`正在请求第${i+1}页内容`)
            await sleep(200);
        }
        setTimeout(async() => {
            while (getResponseNum_Garden() < pageNum) {
                console.log(`正在等待数据返回，请稍后...`);
                await sleep(1000);
            }
            showMessage("数据采集完毕，开始导出excel", "info");

            let header2 = ["时间", "昵称", "礼物"];
            let body2 = [];
            let header = [];
            let data = {};
            let msgList = getMessageList();
            for (let i = 0; i < msgList.length; i++) {
                if (msgList[i].ccsid == 42455 && "infos" in msgList[i]) {
                    for (let i2 = 0; i2 < msgList[i].infos.record.length; i2++) {
                        let item = msgList[i].infos.record[i2];

                        // 逐条
                        if (item.is_reward == 1) {
                            let uniGiftName = "";
                            for (let j = 0; j < item.effect_name.length; j++) {
                                uniGiftName += item.effect_name[j];
                            }
                            body2.push([item.ts, item.nickname, uniGiftName]);
                        }

                        // 统计
                        if (item.uid in data) {
                            let uniGiftName = "";
                            for (let j = 0; j < item.effect_name.length; j++) {
                                uniGiftName += item.effect_name[j];
                                let each = item.effect_name[j].split("×");
                                if (each[0] in data[item.uid].gift) {
                                    data[item.uid].gift[each[0]] += Number(each[1]);
                                } else {
                                    data[item.uid].gift[each[0]] = Number(each[1]);
                                }

                                // 构造header
                                if (header.indexOf(each[0]) == -1) {
                                    header.push(each[0]);
                                }
                            }
                            if (item.is_reward == 1) {
                                if (uniGiftName in data[item.uid].gift) {
                                    data[item.uid].gift[uniGiftName] += 1;
                                } else {
                                    data[item.uid].gift[uniGiftName] = 1;
                                }
                                if (header.indexOf(uniGiftName) == -1) {
                                    header.push(uniGiftName);
                                }
                            }
                        } else {
                            let gift = {};
                            let uniGiftName = "";
                            for (let j = 0; j < item.effect_name.length; j++) {
                                uniGiftName += item.effect_name[j];
                                let each = item.effect_name[j].split("×");
                                gift[each[0]] = Number(each[1]);
                                // 构造header
                                if (header.indexOf(each[0]) == -1) {
                                    header.push(each[0]);
                                }
                            }
                            if (item.is_reward == 1) {
                                gift[uniGiftName] = 1;
                                if (header.indexOf(uniGiftName) == -1) {
                                    header.push(uniGiftName);
                                }
                            }
                            data[item.uid] = {
                                nickname: item.nickname,
                                uid: item.uid,
                                gift: gift
                            }
                        }
                    }
                }
            }
            // console.log("最终结果是", data);
            // console.log("header是", header)

            exportGardenExcel(header, data, header2, body2);
            showMessage("导出成功", "success");

        }, 1500);

    }, 1000);
}


function exportGardenExcel(header, data, header2, body2) {
    let body = [];
    for (const key in data) {
        let item = data[key];
        let each = [item.nickname, item.uid];
        for (let i = 0; i < header.length; i++) {
            if (header[i] in item.gift) {
                each.push(item.gift[header[i]]);
            } else {
                each.push(null);
            }
        }
        body.push(each);
    }
    header.unshift("昵称", "UID");
    exportJsonToExcel(`【${anchor_nickname}】园丁记录`, [
        {
            sheetName: "记录",
            header: header2,
            body: body2
        },
        {
            sheetName: "统计",
            header: header,
            body: body
        }
    ]);
}

