// 食神

async function exportCook() {
    showMessage("开始导出数据，请稍后，进度可在控制台查看", "info");
    let seaLevel = {
        0: "粤菜",
        1: "湘菜",
        2: "川菜",
        3: "鲁菜"
    }
    let fishType = {
        1: "食客",
        2: "美食家",
        3: "食神"
    }
    const SHISHEN_TYPE = 0; // 0为全部
    const PAGE_SIZE = 100;
    let ret = await getShishenData(SHISHEN_TYPE, 1, 10);
    let totalSize = Number(ret.total_size);
    let totalPage = Math.ceil(totalSize / PAGE_SIZE); // 总页数
    console.log(`共${totalPage}页`);

    let header =  ["时间", "投喂数", "菜系", "投喂者", "主播昵称", "主播收获"];
    let body = [];
    // 开始循环获取
    for (let i = 0; i < totalPage; i++) {
        console.log(`正在采集第${i+1}页内容`);
        let ret = await getShishenData(SHISHEN_TYPE, i + 1, PAGE_SIZE);
        for (let j = 0; j < ret.record_list.length; j++) {
            let item = ret.record_list[j];
            body.push([timestampToTime(item.update_time), item.num, seaLevel[item.sea_level] + fishType[item.fish_type], item.nick, item.anchor_nick, item.goldingot_num])
        }
    }

    showMessage("数据采集完毕，开始导出excel", "info");
    exportJsonToExcel(`【${anchor_nickname}】食神记录`, [
        {
            sheetName: "记录",
            header: header,
            body: body
        }
    ])
    showMessage("导出成功", "success");
}


function getShishenData(type, page, size) {
    return new Promise(resolve => {
        GM_xmlhttpRequest({
            method: "GET",
            url: `https://gameapi.cc.163.com/actgamecook2020/fish_record?fish_type=${type}&page=${page}&size=${size}`,
            responseType: "json",
            onload: function(response) {
                let ret = response.response;
                resolve(ret);
            }
        });
    })
}




