function exportShejianExcel(header, data, header2, body2) {
    let body = [];
    for (const key in data) {
        let item = data[key];
        let each = [item.nickname, item.uid];
        for (let i = 0; i < header.length; i++) {
            if (header[i] in item.gift) {
                each.push(item.gift[header[i]]);
            } else {
                each.push(null);
            }
        }
        body.push(each);
    }
    header.unshift("昵称", "UID");
    exportJsonToExcel(`【${anchor_nickname}】射箭记录`, [
        {
            sheetName: "记录",
            header: header2,
            body: body2
        },
        {
            sheetName: "统计",
            header: header,
            body: body
        }
    ]);
}

